// @ts-ignore
import { LeadEntity } from "@/entities/lead.entity";
// @ts-ignore
import { CallEntity } from "@/entities/call.entity";
import { UserNetwork, UserStatus } from "@/types/user";
import { subDays } from "date-fns";

const status: UserStatus[] = [
  "Active",
  "Has potential",
  "Do not call",
  "New",
  "Cold",
  "No potential",
  "Long term call back",
  "Test",
  "No answer",
  "No interest",
  "Call back",
  "Long term call back",
  "Low potentional",
];

const generateUser = (index: number): LeadEntity => {
  let avatar = null;
  let incoming = null;
  let network: UserNetwork = "offline";

  if (index % 3 === 0) {
    network = "online";
    avatar =
      "https://fiverr-res.cloudinary.com/images/t_main1,q_auto,f_auto,q_auto,f_auto/gigs/134842804/original/365d221664d01930cc92b4319c1e61b2e4eebd6f/proffesional-avatar-for-steam.png";
  }
  if (index <= 3) {
    incoming = index;
  }

  const callHistory: CallEntity[] = [
    new CallEntity({
      duration: "1:12",
      type: "incoming",
      date: subDays(new Date(), 1),
    }),
    new CallEntity({
      duration: "0:56",
      type: "outgoing",
      date: subDays(new Date(), 1),
    }),
    new CallEntity({
      duration: "0:12",
      type: "incoming",
      date: subDays(new Date(), 1),
    }),
    new CallEntity({
      duration: "0:56",
      type: "outgoing",
      date: subDays(new Date(), 2),
    }),
    new CallEntity({
      duration: "0:56",
      type: "outgoing",
      date: new Date(),
    }),
    new CallEntity({
      duration: "0:36",
      type: "outgoing",
      date: new Date(),
    }),
  ];

  const userStatus = status[index % status.length];

  return new LeadEntity({
    id: index,
    firstName: `John`,
    lastName: `Doe ${index}`,
    avatar,
    incoming: incoming,
    status: userStatus,
    network,
    country: "Russia",
    phone: "79223222222",
    email: "emailll@gmail.com",
    media: [
      "data:image/jpeg;base64,",
      "data:image/jpeg;base64,",
      "data:image/jpeg;base64,",
      "data:image/jpeg;base64,",
    ],
    callHistory,
  });
};

export const users: LeadEntity[] = [
  ...new Array(20).fill(0).map((_, index) => generateUser(index)),
];
